import { defineMessages } from 'react-intl';

export const scope = 'app.components.IndividualProfile';

export default defineMessages({
  individualProfile: {
    id: `${scope}.individualProfile`,
    defaultMessage: 'Individual Profile',
  },
  firstName: {
    id: `${scope}.firstName`,
    defaultMessage: 'First Name',
  },
  firstNameRequired: {
    id: `${scope}.firstNameRequired`,
    defaultMessage: 'First Name field is required.',
  },
  middleName: {
    id: `${scope}.middleName`,
    defaultMessage: 'Middle Name',
  },
  middleNameRequired: {
    id: `${scope}.middleNameRequired`,
    defaultMessage: 'Middle Name field is required.',
  },
  lastName: {
    id: `${scope}.lastName`,
    defaultMessage: 'Last Name',
  },
  lastNameRequired: {
    id: `${scope}.lastNameRequired`,
    defaultMessage: 'Last Name field is required.',
  },
  idCardNumber: {
    id: `${scope}.idCardNumber`,
    defaultMessage: 'ID Card Number',
  },
  idCardNumberRequired: {
    id: `${scope}.idCardNumberRequired`,
    defaultMessage: 'ID Card Number field is required.',
  },
  invalidCard: {
    id: `${scope}.invalidCard`,
    defaultMessage: 'Enter valid number',
  },
  idCardDocument: {
    id: `${scope}.idCardDocument`,
    defaultMessage: 'ID Card Document',
  },
  idCardDocumentRequired: {
    id: `${scope}.idCardDocumentRequired`,
    defaultMessage: 'ID Card Document field is required.',
  },
  idCardType: {
    id: `${scope}.idCardType`,
    defaultMessage: 'ID Card Type',
  },
  idCardTypeRequired: {
    id: `${scope}.idCardTypeRequired`,
    defaultMessage: 'ID Card Type field is required.',
  },
  status: {
    id: `${scope}.status`,
    defaultMessage: 'Status',
  },
  statusRequired: {
    id: `${scope}.statusRequired`,
    defaultMessage: 'Status field is required.',
  },
  saveButton: {
    id: `${scope}.saveButton`,
    defaultMessage: 'Save & Next',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  dragAndDropMessage: {
    id: `${scope}.dragAndDropMessage`,
    defaultMessage: 'Drag and drop a file here, or click to select file.',
  },
  dropFilesHere: {
    id: `${scope}.dropFilesHere`,
    defaultMessage: 'Drop your files here...',
  },
  individualProfileSaveSuccess: {
    id: `${scope}.individualProfileSaveSuccess: {
      `,
    defaultMessage: 'Individual Profile Save Success',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong: {
      `,
    defaultMessage: 'Something Went Wrong!',
  },
  dropFileHere: {
    id: `${scope}.dropFileHere: {
      `,
    defaultMessage: 'Drop files Here',
  },
});
